        Animal.Type.FISH, new HashMap<>(Map.of(Animal.Sex.F, fishF, Animal.Sex.M, fishM)),
        Animal.Type.SPIDER, new HashMap<>(Map.of(Animal.Sex.F, spiderF, Animal.Sex.M, spiderM))));

    private static int nextInt(int a, int b) {
        return new Random().nextInt(b - a + 1) + a;
    }

    private static int getAge(Animal.Type type) {
        return switch (type) {
            case CAT -> nextInt(4, 18);
            case DOG -> nextInt(4, 13);
            case BIRD -> nextInt(4, 15);
            case FISH -> nextInt(3, 10);
            case SPIDER -> nextInt(4, 25);
        };
