            case CAT -> nextInt(23, 25);
            case DOG -> nextInt(15, 110);
            case BIRD -> nextInt(9, 20);
            case FISH -> nextInt(2, 10);
            case SPIDER -> nextInt(4, 13);
        };
    }

    private static double getWeight(Animal.Type type) {
        return switch (type) {
            case CAT -> nextInt(3, 7);
            case DOG -> nextInt(2, 110);
            case BIRD -> new Random().nextDouble(0.8) + 0.2;
            case FISH -> new Random().nextDouble(0.4) + 0.2;
            case SPIDER -> new Random().nextDouble(0.1) + 0.05;
        };
    }

    private static String getType(Animal.Type type) {
        return switch (type) {
            case CAT -> "Animal.Type.CAT";
            case DOG -> "Animal.Type.DOG";
            case BIRD -> "Animal.Type.BIRD";
            case FISH -> "Animal.Type.FISH";
            case SPIDER -> "Animal.Type.SPIDER";
        };
    }

    private static String getSex(Animal.Sex sex) {
        return switch (sex) {
            case F -> "Animal.Sex.F";
            case M -> "Animal.Sex.M";
        };
    }

    private static String generate(String name) {
        var type = Animal.Type.values()[nextInt(0, 4)];
        var sex = Animal.Sex.values()[nextInt(0, 1)];
        var animalName = animalNames.get(type).get(sex).get(nextInt(0, 9));

        var age = getAge(type);
        var height = getHeight(type);
        var weight = getWeight(type);

        var bites = new Random().nextBoolean();

        DecimalFormatSymbols decimalFormatSymbols = new DecimalFormatSymbols(Locale.US);
        decimalFormatSymbols.setDecimalSeparator('.');
        DecimalFormat decimalFormat = new DecimalFormat("#0.00", decimalFormatSymbols);

        return String.format("var %s = new Animal(\"%s\", %s, %s, %d, %d, %s, %b);", name, animalName, getType(type), getSex(sex), age, height, decimalFormat.format(weight), bites);
    }

    private static void generateList(int n) {
        for (int i = 0; i < n; ++i) {
            System.out.println(generate(String.format("animal%d", i + 1)));
        }

        StringBuilder list = new StringBuilder();

        list.append("var animals = new ArrayList<>(List.of(");

        for (int i = 0; i < n - 1; ++i) {
            list.append(String.format("animal%d, ", i + 1));
        }

        list.append(String.format("animal%d", n));
        list.append("));");

        System.out.println("\n" + list);
    }

    /**
     * Sort the animals in ascending order by their height
     *
     * @param animals Animals
     * @return The list of animals in ascending order by their height
     */
    static List<Animal> sortByHeight(List<Animal> animals) {
        return animals.stream()
            .sorted(Comparator.comparingInt(Animal::height))
            .toList();
    }

